import react from 'react';
import Navbar from 'react-bootstrap/Navbar';

function NavBar() {
  return (
    <div>
        <Navbar className="bg-body-secondary justify-content-between" style={{ color: 'red'}}>
            <Navbar.Brand style={{color: 'blue'}}>Navbar</Navbar.Brand>
        </Navbar>
    </div>
  );
}

export default NavBar;
